create table PCEADMISSOES
(
  INT_EPISODIO           NUMBER(8) not null
    primary key,
  NUM_MECANOGRAFICO      NUMBER(5),
  NUM_SEQUENCIAL         NUMBER(8),
  DTA_INTERNAMENTO       DATE,
  HORA_INTERNAMENTO      NUMBER(5),
  TIPO_ADMISSAO          CHAR,
  COD_PROVENIENCIA       NUMBER(2),
  COD_UNID_SAUDE_PROV    NUMBER(7),
  COD_ESPECIALIDADE_PROV NUMBER(5),
  NUM_EPISODIO_PROV      NUMBER(8),
  COD_SUBSISTEMA_RESP    NUMBER(6),
  NUM_BENEFICIARIO       VARCHAR2(20),
  DTA_ANULA              DATE,
  REMOVER                NUMBER(1)
)
/

create index IPCEADM
  on PCEADMISSOES (NUM_SEQUENCIAL)
/

